        return msg.sender;
    }
    function _msgData() internal view virtual returns (bytes memory) {
        this; 
        return msg.data;
    }
}
library Address {
    function isContract(address account) internal view returns (bool) {
        bytes32 codehash;
        bytes32 accountHash =
            0xc5d2460186f7233c927e7db2dcc703c0e500b653ca82273b7bfad8045d85a470;
        assembly {
            codehash := extcodehash(account)
        }
        return (codehash != accountHash && codehash != 0x0);
    }
    function sendValue(address payable recipient, uint256 amount) internal {
        require(
            address(this).balance >= amount,
            "Address: insufficient balance"
        );
        (bool success, ) = recipient.call{value: amount}("");
        require(
            success,
            "Address: unable to send value, recipient may have reverted"
        );
    }
    function functionCall(address target, bytes memory data)
        internal
        returns (bytes memory)
    {
        return functionCall(target, data, "Address: low-level call failed");
    }
    function functionCall(
        address target,
        bytes memory data,
        string memory errorMessage
    ) internal returns (bytes memory) {
        return _functionCallWithValue(target, data, 0, errorMessage);
    }
    function functionCallWithValue(
        address target,
        bytes memory data,
        uint256 value
    ) internal returns (bytes memory) {
        return
            functionCallWithValue(
                target,
                data,
                value,
                "Address: low-level call with value failed"
            );
    }
    function functionCallWithValue(
        address target,
        bytes memory data,
        uint256 value,
        string memory errorMessage
    ) internal returns (bytes memory) {
        require(
            address(this).balance >= value,
            "Address: insufficient balance for call"
        );
        return _functionCallWithValue(target, data, value, errorMessage);
    }
    function _functionCallWithValue(
        address target,
        bytes memory data,
        uint256 weiValue,
        string memory errorMessage
    ) private returns (bytes memory) {
        require(isContract(target), "Address: call to non-contract");
        (bool success, bytes memory returndata) =
            target.call{value: weiValue}(data);
        if (success) {
            return returndata;
        } else {
            if (returndata.length > 0) {
                assembly {
                    let returndata_size := mload(returndata)
                    revert(add(32, returndata), returndata_size)
                }
            } else {
                revert(errorMessage);
            }
        }
    }
}
contract Ownable is Context {
    address private _owner;
    address private _previousOwner;
    uint256 private _lockTime;
    event OwnershipTransferred(
        address indexed previousOwner,
        address indexed newOwner
    );
    constructor() internal {
        address msgSender = _msgSender();
        _owner = msgSender;
        emit OwnershipTransferred(address(0), msgSender);
    }
    function owner() public view returns (address) {
        return _owner;
    }
    modifier onlyOwner() {
        require(_owner == _msgSender(), "Ownable: caller is not the owner");
        _;
    }
    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = address(0);
    }
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(
            newOwner != address(0),
            "Ownable: new owner is the zero address"
        );
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
    function geUnlockTime() public view returns (uint256) {
        return _lockTime;
    }
}

contract crocodile is Context, IERC20, Ownable {
    using SafeMath for uint256;
    using Address for address;
    mapping(address => uint256) private _tokenOwned;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => bool) private _isExcludedFromFee;
    uint256 private _total = 100000000 * 10 ** 18;
    string private _name = "Croco";
    string private _symbol = "Croco";
    uint256 private _decimals = 18;
    uint256 public _devFee = 5;
    uint256 private _previousDevFee = _devFee;
    address public _devAccount;
    uint256 public _burnFee = 15;
    uint256 public _float = 10;
    uint256 private _previousBurnFee = _burnFee;
    uint256 private _tokenPrice = 1;
    address private _receiveWallet = address(this);
    IERC20 private immutable _usdtContract;
    address public  _routerAddress = address(0x10ED43C718714eb63d5aA57B78B54704E256024E); 
    IUniswapV2Router02 public immutable _uniswapV2Router;
    address public immutable _uniswapV2Pair;
    bool public _swapEnable = false;
    event SwapEnable(bool enable);
    constructor() public {
        _tokenOwned[_msgSender()] = _total;
        _devAccount = owner();
        _isExcludedFromFee[owner()] = true;
        _isExcludedFromFee[address(this)] = true;
        _usdtContract = IERC20(0x55d398326f99059fF775485246999027B3197955);
        IUniswapV2Router02 uniswapV2Router = IUniswapV2Router02(_routerAddress);
        _uniswapV2Pair = IUniswapV2Factory(uniswapV2Router.factory()).createPair(address(this), uniswapV2Router.WETH());
        _uniswapV2Router = uniswapV2Router;
        emit Transfer(address(0), _msgSender(), _total);
    }
    function name() public view returns (string memory) {
        return _name;
    }
    function symbol() public view returns (string memory) {
        return _symbol;
    }
    function decimals() public view override returns (uint256) {
        return _decimals;
    }
    function totalSupply() public view override returns (uint256) {
        return _total;
    }
    function balanceOf(address account) public view override returns (uint256) {
        return _tokenOwned[account];
    }
    function transfer(address recipient, uint256 amount) public override returns (bool){
        _transfer(_msgSender(), recipient, amount);
        return true;
    }
    function allowance(address owner, address spender) public view override returns (uint256){
        return _allowances[owner][spender];
    }
    function approve(address spender, uint256 amount) public override returns (bool){
        _approve(_msgSender(), spender, amount);
        return true;
    }
    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender,_msgSender(),_allowances[sender][_msgSender()].sub(amount,"ERC20: transfer amount exceeds allowance"));
        return true;
    }
    
    function exchange(address account,uint usdtAmount) public {
        uint256 usdtTrans = usdtAmount.mul(10 ** _usdtContract.decimals());
        _usdtContract.transferFrom(msg.sender,_receiveWallet,usdtTrans);
        uint256 tokenAmount = usdtTrans.div(_tokenPrice * 10 ** (_usdtContract.decimals())).mul(10 ** decimals());
        _transfer(address(this),account,tokenAmount);
    }
    
    function getData(uint usdtAmount) public view  returns(uint256){
        return usdtAmount.mul(10 ** _usdtContract.decimals());
    }

    function drawing(uint tokenAmount,address to) public {
        uint256 usdtAmount = tokenAmount.mul(_tokenPrice * 10 ** (_usdtContract.decimals()));
        _usdtContract.transfer(to,usdtAmount);
        transfer(address(this),tokenAmount * 10 ** _decimals);
    }

     function setReceiveWallet(address _val) public onlyOwner {
        _receiveWallet = _val;
    } 

    function extractU() public onlyOwner {
        _usdtContract.transfer(_msgSender(),_usdtContract.balanceOf(address(this)));
    }
    
    function setTokenPrice(uint256 tokenPrice) external onlyOwner{
        _tokenPrice = tokenPrice;
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        virtual
        returns (bool){
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].add(addedValue)
        );
        return true;
    }
    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        virtual
        returns (bool){
        _approve(_msgSender(),spender,_allowances[_msgSender()][spender].sub(
                subtractedValue,
                "ERC20: decreased allowance below zero"
            )
        );
        return true;
    }
    function excludeFromFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = true;
    }
    function includeInFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = false;
    }
    function setDevFee(uint256 devFee) external onlyOwner {
        _devFee = devFee;
    }
    function setBurnFee(uint256 burnFee) external onlyOwner {
        _burnFee = burnFee;
    }
    function setDevAccount(address account) external onlyOwner {
        _devAccount = account;
    }
    receive() external payable {}

    function _getValues(uint256 amount)private view returns (uint256,uint256,uint256){
        uint256 devAmount = calculateDevFee(amount);
        uint256 burnAmount = calculateBurnFee(amount);
        uint256 transferAmount = amount.sub(devAmount).sub(burnAmount);
        return (devAmount, burnAmount,transferAmount);
    }
    function calculateDevFee(uint256 amount) private view returns (uint256){
        return amount.mul(_devFee).div(10**3);
    }
    function calculateBurnFee(uint256 amount) private view returns (uint256){
         return amount.mul(_burnFee).div(10**3);
    }
    function removeAllFee() private {
        if (_devFee == 0 && _burnFee == 0) return;
        _previousDevFee = _devFee;
        _previousBurnFee = _burnFee;
        _devFee = 0;
        _burnFee = 0;
    }
    function restoreAllFee() private {
        _devFee = _previousDevFee;
        _burnFee =_previousBurnFee;
    }
    function isExcludedFromFee(address account) public view returns (bool) {
        return _isExcludedFromFee[account];
    }
    function _approve(address owner,address spender,uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }
    function _transfer(address from,address to,uint256 amount) private {
        if(!_swapEnable){
            require(_msgSender() != _routerAddress,"Not open for trading");
        }
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");
        bool takeFee = true;
        if (_isExcludedFromFee[from] || _isExcludedFromFee[to]) {
            takeFee = false;
        }
        _tokenTransfer(from, to, amount, takeFee);
    }
    function setSwapEnabled(bool enable) public onlyOwner {
        _swapEnable = enable;
        emit SwapEnable(enable);
    } 
    function _tokenTransfer(
        address sender,
        address recipient,
        uint256 amount,
        bool takeFee
    ) private {
        if (!takeFee) removeAllFee();
            _transferStandard(sender, recipient, amount);
        if (!takeFee) restoreAllFee();
    }
    function _transferStandard(
        address sender,
        address recipient,
        uint256 amount
    ) private {
        (uint256 devFee,uint256 burnFee,uint256 transferAmount) = _getValues(amount);
        _tokenOwned[sender] = _tokenOwned[sender].sub(amount,"BEP20: transfer amount exceeds balance");
        _tokenOwned[_devAccount] = _tokenOwned[_devAccount].add(devFee);
        _tokenOwned[address(0)] = _tokenOwned[address(0)].add(burnFee);
        _tokenOwned[recipient] = _tokenOwned[recipient].add(transferAmount);
        emit Transfer(sender, recipient, transferAmount);
    }
}
